webpackJsonp([0x79d45c372f9a],{407:function(e,t){e.exports={data:{markdownRemark:{html:'<h5>Smart Room</h5>\n<blockquote>\n<p>Mar 2016 - May 2016</p>\n</blockquote>\n<img src="https://raw.githubusercontent.com/pinardy/pinardy.github.io/source/src/assets/images/projects/Front-AngledView.PNG" alt="smartroom1" width="350" height="300">\n<img src="https://github.com/pinardy/pinardy.github.io/blob/source/src/assets/images/projects/Front-View.PNG?raw=true" alt="smartroom2" width="350" height="300">\n<p>Through the interfacing of the Raspberry Pi 3 with sensors and devices, the Smart Room aims to automate tasks such as turning on/off the lights and aircon. The Smart Room accounts for users who forget to switch off the lights and aircon. Algorithms are designed carefully to provide a smooth and undisruptive experience to the users.</p>\n<hr>\n<!-- -------------------------------------------------------- -->\n<h5>Luminous (Multiplayer Android Game)</h5>\n<blockquote>\n<p>Feb 2017 - May 2017</p>\n</blockquote>\n<img src="https://raw.githubusercontent.com/pinardy/pinardy.github.io/source/src/assets/images/projects/game_main.jpg" alt="game" width="400" height="230">\n<img src="https://raw.githubusercontent.com/pinardy/pinardy.github.io/source/src/assets/images/projects/game_1.png" alt="game" width="400" height="230">\n<p><a href="https://github.com/pinardy/Luminous/">Source code</a></p>\n<p>The world has been corrupted with shadows. It is up to you (and your team) to protect the heart of the world from creeping shadows. Luminous was created using the LibGDX library on Android, using NodeJS as the server. </p>\n<p>This project allowed me to practice good software programmming practices such as Git version control, Object-Oriented arrangement of game objects, testing, and more.</p>\n<hr>\n<!-- -------------------------------------------------------- -->\n<h5>Booklink (Web App)</h5>\n<blockquote>\n<p>Oct 2017 - Dec 2017</p>\n</blockquote>\n<img src="https://raw.githubusercontent.com/pinardy/pinardy.github.io/source/src/assets/images/projects/booklink1.JPG" alt="booklink1" width="350" height="200">\n<img src="https://raw.githubusercontent.com/pinardy/pinardy.github.io/source/src/assets/images/projects/booklink2.JPG" alt="booklink2" width="350" height="200">\n<p><a href="https://github.com/pinardy/Booklink/">Source code</a></p>\n<p>Made using Django, Booklink allows avid book readers to shop for their favourite books, while checking out other books in a seamless experience. Python and SQL are used extensively in this project. </p>\n<hr>\n<!-- -------------------------------------------------------- -->\n<h5>Travelpedia</h5>\n<blockquote>\n<p>Oct 2016 </p>\n</blockquote>\n<img src="https://github.com/pinardy/pinardy.github.io/blob/source/src/assets/images/projects/travelpedia.png?raw=true" width="200" height="80">\n<br>\n<img src="https://raw.githubusercontent.com/pinardy/pinardy.github.io/source/src/assets/images/projects/travelpedia1.png" width="180" height="300">\n<img src="https://raw.githubusercontent.com/pinardy/pinardy.github.io/source/src/assets/images/projects/travelpedia2.png" width="180" height="300">\n<img src="https://raw.githubusercontent.com/pinardy/pinardy.github.io/source/src/assets/images/projects/travelpedia3.png" width="180" height="300">\n<p><a href="https://github.com/pinardy/Travelpedia/">Source code</a></p>\n<p>Travelpedia was created to aid tourists in their stay in Singapore. Tourists can plan their daily itinerary, locate tourist attractions on the map, and discover the tourists attractions in Singapore. </p>\n<p>Travelpedia was created on Android Studio</p>\n<hr>\n<!-- -------------------------------------------------------- -->\n<h5>Classy</h5>\n<blockquote>\n<p>Nov 2016 - Dec 2016</p>\n</blockquote>\n<img src="https://raw.githubusercontent.com/pinardy/pinardy.github.io/source/src/assets/images/projects/classy.png" alt="smartroom" width="150" height="200">\n<p><a href="https://github.com/pinardy/Classy">Source code</a>\n<br></p>\n<p>During class, teachers have experienced occasions where there is no class participation. A possibility for this silence is students being shy or not confident enough to ask questions during lessons. </p>\n<p>Classy aims to encourage communication between teacher and student, hence enhancing the overall teaching and learning experience. </p>\n<p>Classy was created on Android Studio.</p>\n<hr>\n<!-- -------------------------------------------------------- -->\n<h5>Sentiment Analysis</h5>\n<blockquote>\n<p>Oct 2017 - Dec 2017</p>\n</blockquote>\n<img src="https://raw.githubusercontent.com/pinardy/pinardy.github.io/source/src/assets/images/projects/sentiment-analysis.jpg" alt="smartroom" width="300" height="150">\n<p><a href="https://github.com/pinardy/sentiment-analysis">Source code</a></p>\n<p>The aim of this sentiment analysis project is to design a sequence labelling model for informal texts using the Hidden Markov Model (HMM). The sequence labelling system for informal texts can serve as the very first step towards building a more complex, intelligent sentiment analysis system for social media text.</p>\n<p>The Hidden Markov Model was designed from scratch using the Python programming language, with the aid of numpy and pandas.</p>\n<hr>\n<!-- -------------------------------------------------------- -->\n<h5>Gesture</h5>\n<blockquote>\n<p>June 2016 - Aug 2016</p>\n</blockquote>\n<img src="https://raw.githubusercontent.com/pinardy/pinardy.github.io/source/src/assets/images/projects/gesture_ui.png" alt="smartroom" width="300" height="150">\n<img src="https://raw.githubusercontent.com/pinardy/pinardy.github.io/source/src/assets/images/projects/gesture.JPG" alt="smartroom" width="150" height="130">\n<p>There is a barrier between musicians and non-musicians in having fun jamming together. Gesture is a musical platform created to allow users with little to no musical background to jam together with friends and have fun. Gesture is created on Unreal Engine with the use of a Leap motion sensor, bringing the user into virtual reality. </p>',frontmatter:{title:"Portfolio"}}},pathContext:{slug:"/portfolio/projects/"}}}});
